import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';
import BasePage from '../components/layouts/BasePage';

class Cv extends React.Component {
    render() {
        return (
            <BaseLayout>
                <BasePage>
                    <h1>I am Cv Page</h1>
                </BasePage>
            </BaseLayout>
        );
    }
}

export default Cv;
